import React from 'react';
import {Pagination} from "react-bootstrap";

const PaginationPubl = ({items, onClick}) => {
    return (
        items.map(item => {
            return <Pagination onClick={onClick}>{item}</Pagination>
        })
    );
};

export default PaginationPubl;
